rule task_enabled {
    strings:
        $1 = "<Enabled>true</Enabled>" nocase wide ascii
    condition:
        any of them
}

rule task_author_user {
    strings:
        $1 = /<Author>[A-Za-z0-9_-]+\\\\%%%USERNAME%%%<\/Author>/ nocase wide ascii
    condition:
        any of them
}

rule task_author_system {
    strings:
        $1 = "<Author>SYSTEM</Author>" nocase wide ascii
    condition:
        any of them
}

rule task_perm_highest {
    strings:
        $1 = "<RunLevel>HighestAvailable</RunLevel>" nocase wide ascii
    condition:
        any of them
}

rule task_perm_lowest {
    strings:
        $1 = "<RunLevel>LeastPrivilege</RunLevel>" nocase wide ascii
    condition:
        any of them
}

rule task_command_cmd {
    strings:
        $1 = "<Command>C:\\Windows\\System32\\cmd.exe" nocase wide ascii
    condition:
        any of them
}

rule task_command_exe {
    strings:
        $1 = /<Command>.*\.(exe)<\/Command>/ nocase wide ascii
    condition:
        any of them
}

rule task_command_bat {
    strings:
        $1 = /<Command>.*\.(bat)<\/Command>/ nocase wide ascii
    condition:
        any of them
}

rule task_command_dot_cmd {
    strings:
        $1 = /<Command>.*\.(cmd)<\/Command>/ nocase wide ascii
    condition:
        any of them
}

rule task_command_ps1 {
    strings:
        $1 = /<Command>.*\.(ps1)<\/Command>/ nocase wide ascii
    condition:
        any of them
}

rule task_argument {
    strings:
        $1 = /<Arguments>[^<]+<\/Arguments>/ nocase wide ascii
    condition:
        any of them
}

rule task_working_directory {
    strings:
        $1 = /<WorkingDirectory>[^<]+<\/WorkingDirectory>/ nocase wide ascii
    condition:
        any of them
}

rule task_hidden {
    strings:
        $1 = "<Hidden>true</Hidden>" nocase wide ascii
    condition:
        any of them
}

rule task_runs_on_logon {
    strings:
        $1 = "<LogonTrigger>" nocase wide ascii
    condition:
        any of them
}

rule task_in_windows_namespace {
    strings:
        $1 = /<URI>\\Microsoft\\Windows\\[^<]+<\/URI>/ nocase wide ascii
    condition:
        any of them
}

rule task_runs_as_admin_account {
    strings:
        $1 = /<UserId>.*\\Administrator<\/UserId>/ nocase wide ascii
    condition:
        any of them
}

rule task_execution_time_limit_extended {
    strings:
        $1 = /<ExecutionTimeLimit>P([3-9]|[1-9][0-9]+)D<\/ExecutionTimeLimit>/ nocase wide ascii
    condition:
        any of them
}

rule task_context_author {
    strings:
        $1 = /<Actions Context="Author">/ nocase wide ascii
    condition:
        any of them
}
